export default function Main() {

  const allNewDice = () => {
    const arr = [];
    for (let i = 0; i < 10; i++) {
        arr.push(Math.floor(Math.random() * 6) + 1);
    }

    return arr;
  }

  console.log(allNewDice());

  return (
    <main
      className="main"
      style={{
        width: '80vh',
        height: '80vh',
        marginTop: '50px',
        backgroundColor: '',
        borderRadius: '10px',
        backgroundColor:'#F5F5F5',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center'
      }}
    >
        <div
            style={{
                display: "grid",
                gridTemplate: '50px 50px / 50px 50px 50px 50px 50px',
                gap: '20px'
            }}
        >
        </div>
    </main>
  );
};
